description:
Category HD - Shot In High Def, Feature, Couples 

Director James Avalon 

Starring India Summer, Lily Labeau, Evan Stone, Xander Corvus, Avril Hall 



Featuring India Summer &amp; Evan Stone!

Sweet Sinner brings you a nice suburban tale of neighborly friendship, trust, betrayal and lies. When Lando (Xander Corvus) and Jessica (Avril Hall) move in with the scheming Natasha (India Summer), neighboring Billy (Evan Stone) knows something isn't right. Billy's daughter (Lily LaBeau), however, is intrigued by the rough Lando. What starts out as warm introductions ultimately reveals deep plots of seduction and blackmail. But things never go as planned when lust is on the line. Directed by James Avalon! 

